import axios from 'axios';
import TestBody from './components/TestBody'
import "./App.css";

const App = () => {

  const [objects, setObjects] = useState([]);

  //Met API test
  const searchMet  =  () => {
    axios.get("https://collectionapi.metmuseum.org/public/collection/v1/search?q=sunflowers").then(res => 
    setObjects(res.data));

  }
  //Artsy API test

    return (
      <div className="App">
       <TestBody searchMet={searchMet}/>
      </div>
    );

}

export default App;
